import {SET_USER_LIBRARY} from "./actions";

const defaultState = {};

export const userLibraryReducer = (state = defaultState, action) => {
    switch (action.type) {
        case SET_USER_LIBRARY:
            let userLibrary = {};
            for (let component of action.payload) {
                userLibrary[component.component_name] = component.params;
            }
            return userLibrary;

        default:
            return state;
    }
}
